import React from "react";
import "./Contacts.css";

export const Contact = () => (
  <div class="contact_page">
    <div className="papa_contact text-center">
      <div className="texto_contact">
        <button type="button" class="btn btn-lg btn-so">
          <p>
            Earphone icon: <span class="glyphicon glyphicon-earphone"></span>
          </p>
          <span>Stack Overflow</span>
        </button>
      </div>
    </div>
  </div>
);
